//console.log("Loading DefaultLib.js");
function Default() {
    this.setupdir="def/"; // defaults directory
    this.setup="defaults.json"; // defaults file, contains default setup...
    this.path="test.json";
    this.current={};
    this.start=undefined; // setup at start
    this.JsonMapFill={"other":["other"],
		      "trash":["trash"]
		     }; // keep Default/Url if it already exists, otherwise get from setup-file
    this.JsonMapForce={"Threshold":{"thrs":["thrs"]},
		       "Colors":{"colors":["colors"]},
		       "Path":{"order":["order"],
			       "select":["select"],
			       "home":["home"],
			       "tooltip":["tooltip"]},
		       "Layout":{"priority":["priority"],
				 "state":["state"]}
		      }; // overwrite Default/Url with setup-file no-matter-what
    this.DefaultMapFill={"Threshold":{"thrs":["Threshold","thrs"]},
			 "Colors":{"colors":["Colors","colors"]},
			 "Path":{"order":["Path","order"],
				 "home":["Path","home"],
				 "tooltip":{"keys":["Path","tooltip","keys"],
					    "select":["Path","tooltip","select"],
					    "sort":["Path","tooltip","sort"],
					    "click":["Path","tooltip","click"]},
				 "select":["Path","select"]
				},
			 "Layout":{"priority":["Layout","priority"],
				   "state":["Layout","state"]}
			}; // overwrite state with default/url/setup, no-matter-what
    this.init=function(state){
	var par="setup";
	state.Utils.init(par,this);
    };
    this.loadDefault=function(state, callbacks ) {
	var file=this.setup;
	console.log("Default setup:",file);
	if (state.Threshold.thrs !== undefined) { // defaults already loaded, execute callback...
	    state.File.next(state,"",callbacks);
	} else {
	    var path=state.Default.setupdir + state.Default.setup;
	    state.File.load(state,path,callbacks);
	}
    };
    this.processDefault=function(state,response,callbacks) {
	if (state.Threshold.thrs !== undefined) { // defaults already loaded, execute callback...
	    state.File.next(state,"",callbacks);
	} else {
	    try {
		var json = JSON.parse(response);
	    } catch (e) {
		alert("Default '"+state.Default.setup+"' contains Invalid JSON:"+e.name+":"+e.message);
	    }
	    if (json !== undefined) {
		//console.log("state:",JSON.stringify(state.Path));

		state.Utils.mapFill(state,state.Default.JsonMapFill,state.Default.current,json);
		state.Utils.mapForce(state,state.Default.JsonMapForce,state.Default.current,json);
		state.Utils.mapFill(state,state.Default.DefaultMapFill,state,state.Default.current);

		//console.log("JSON:",JSON.stringify(json.tooltip));
		//console.log("Default:",JSON.stringify(state.Default.Path.tooltip));
		//console.log("State:",JSON.stringify(state.Path.tooltip));

	    };
	    if (state.Default.start === undefined) {
		state.Default.start={};
		state.Utils.mapFill(state,state.Default.DefaultMapFill,state.Default.start,state);
		//state.Default.save(state);
	    }
	    // finally execute next callback
	    state.File.next(state,"",callbacks);
	}
    };
    this.resetDefault=function(state,response,callbacks) {
	try {
	    var json = JSON.parse(response);
	} catch (e) {
	    alert("Default '"+state.Default.setup+"' contains Invalid JSON:"+e.name+":"+e.message);
	}
	if (json !== undefined && state.Default.start !== undefined) {
	    //console.log("state:",JSON.stringify(state.Path));
	    state.Default.current={};
	    state.Utils.mapFill(state,state.Default.JsonMapFill,state.Default.current,json);
	    state.Utils.mapForce(state,state.Default.JsonMapForce,state.Default.current,json);
	    state.Utils.mapFill(state,state.Default.DefaultMapFill,state.Default.start,state.Default.current);
	    state.Utils.mapForce(state,state.Default.DefaultMapFill,state,state.Default.current);
	    //console.log("JSON:",JSON.stringify(json.tooltip));
	    //console.log("Default:",JSON.stringify(state.Default.Path.tooltip));
	    //console.log("State:",JSON.stringify(state.Path.tooltip));

	};
    };
    this.getSetup=function(state) {
	var setup=state.Utils.cp(state.Default.start);
	// get updated information
	state.Utils.mapFill(state,state.Default.DefaultMapFill,setup,state);
	//JSON.stringify(setup, null, "   ");
	return setup;
    };
    this.save=function(state) {
	var setup=state.Utils.prettyJson(state.Default.getSetup(state));
	state.Utils.save(setup,"setup.json","json");
    };
    this.hasChanged=function(state,main,item) {
	if (state.Default!==undefined && 
	    state.Default[main]!==undefined &&
	    state.Default[main][item]!==undefined) {
	    var src=JSON.stringify(state[main][item]);
	    var trg=JSON.stringify(state.Default[main][item]);
	    //console.log("Checking:",main,item,"\n",src,"\n",trg,"->",src!==trg);
	    return src!==trg;
	} else {
	    return true;
	}
    };
};
export default Default;
